import Container from 'react-bootstrap/Container'
import Row from 'react-boostrap/Row'
import './App.css';
import CheckboxListSecondary from './Components/ListDrivers';
import DriverSearchByLocation from './Components/DriverSearchForm'
import React from "react"

function App() {
  return (
  <div classname='App'>
    <Container>
      <Row>
        <DriverSearchByLocation></DriverSearchByLocation>
      </Row>
    </Container>
  </div>
  );
}

export default App;
